import React from "react";
import { Route, Switch } from "react-router-dom";

import App from "../App";
import Login from "../pages/Login";
import Profile from "../pages/Profile";
import Home from "../pages/Home";
import TicketList from "../pages/TicketList";
import Pemesanan from "../pages/Pemesanan";
import Sayonara from "../pages/Sayonara";
import Penukaran from "../pages/Penukaran";

const MainRoute = () => {
  return (
    <Switch>
      <Route exact path="/" component={App} />
      <Route path="/home" component={Home} />
      <Route path="/profile" component={Profile} />
      <Route path="/login" component={Login} />
      <Route path="/pemesanan" component={Pemesanan} />
      <Route path="/ticketlist" component={TicketList} />
      <Route path="/penukuran" component={Penukaran} />
      <Route path="/sayonara" component={Sayonara} />
    </Switch>
  );
};

export default MainRoute;
